def preprocess(filename=None, dstFolder=None):
    util=Utilities.Utility()
    print('Processing ' + filename)
    content = util.readFileContent(filename=filename)
    tokens = util.tokenize(rawStr=content, removeStopwords=True, toLowercase=True, replaceSlash=True,
                           flatEmail=True, flatMonth=True, flatNumber=True, lemmatize=True)
    string = util.tokensToStr(tokens, ' ')
    newFilename = dstFolder + '/' + filename.split('/')[-1]
    util.saveStringToFile(string,newFilename)

