    def deleteFilesInFolder(self, keepfolder,deletefolder):
        #file_private_32_086d899a7cba2a475e9045a2f13102be2a6e4620_32_1400220_002.
        import glob
        counter=0
        cvSet1=set()
        cvSet2=set()
        self.util.logInfo('deleteFilesInFolder',' Processing ' + keepfolder)
        for cv1 in glob.iglob(keepfolder + '/*.cvd2v', recursive=True):
            hash1 = cv1.split('_')[-4]
            cvSet1.add(hash1)

        self.util.logInfo('deleteFilesInFolder', ' Processing ' + deletefolder)
        for cv2 in glob.iglob(deletefolder + '/*.cvd2v', recursive=True):
            hash2 = cv2.split('_')[-4]
            cvSet2.add(hash2)

        self.util.logInfo('deleteFilesInFolder', ' Processing intersection' )
        overlapCVset=cvSet1.intersection(cvSet2)
        self.util.logInfo('deleteFilesInFolder', str(len(overlapCVset)) + ' intersected hash found.')
        #delete overlap from train folder
        import glob, os

        for hash in overlapCVset:
            for f in glob.glob(deletefolder+"/*"+hash+"*.cvd2v"):
                os.remove(f)
                counter=counter+1
                if (counter%100==0):
                    self.util.logInfo('deleteFilesInFolder',str(counter) + ' files deleted.')
                    self.util.logInfo('deleteFilesInFolder', 'Example: ' + f)

